import logo from './logo.svg';
import './App.css';
import { Parallax } from 'react-parallax';
import { NaviBarComponent } from './components/NavigationBar';
import Typewriter from "typewriter-effect";
<script src="https://cdn.jsdelivr.net/npm/tsparticles-preset-sea-anemone@1/tsparticles.preset.seaAnemone.bundle.min.js"></script>
import Particles from "react-tsparticles";
const options = {
  preset: "seaAnemone",
};


function App() {
  return (
    <div className="App">
     <Particles options={options} i/>
      <NaviBarComponent />
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>

      <div className='typer'>
        <Typewriter onInit={(typewriter) => {
          typewriter
            .typeString("if money weren't an object, \nwhat would you do with your life?")
            .pauseFor(3000)
            .deleteAll()
            .typeString("whoops sorry, i'm gurjit ਗੁਰਜੀਤ")
            .start();
        }}
        />
      </div>
      <br /><br /><br /><br /><br />
      <div className='parallaxBox'>
        <Parallax className='mr-auto' strength={200} renderLayer={(percentage) => (
          <div>
            <div
              style={{
                position: "absolute",
                marginLeft: "50%",
                borderRadius: "50%",
                left: "50%",
                top: "50%",
                margin: "auto",
                transform: "translate(-50%,-50%)",
                width: percentage * 500,
                height: percentage * 500,
                backgroundImage: "url('https://pbs.twimg.com/profile_images/1409628661486133248/Ne-x4N7D_400x400.jpg')",
                border: "lavender 5px solid"
              }}
            />
          </div>
        )}
        >
          <div className='insideStyles' style={{ height: 539 }} />
          <p>Gurjit is an aspiring software developer currently studying at the University of Maryland - College Park.</p>
        </Parallax>
      </div>
    </div>
  );
}

export default App;
